import React from "react";
import { Link } from "react-router-dom";
import IndexNavbar from "components/Navbars/IndexNavbar.js";

export default function Index() {
  return (
    <>
      <IndexNavbar fixed />
      <div className="home-container">
        {/* Hero Section */}
        <section className="hero-section">
          <div className="content-wrapper">
            <div className="hero-content">
              <h1 className="hero-title">
                <span className="primary-text">UBCI</span> HR MANAGER
              </h1>
              <p className="hero-description">
                UBCI RH est une plateforme dédiée à la gestion des ressources humaines de la banque UBCI, 
                facilitant le suivi du personnel, la gestion des congés et l'automatisation des tâches administratives.
              </p>
              <div className="action-buttons">
                <Link to="/postule" className="btn-primary">
                  Postuler
                </Link>
                <Link to="/signin" className="btn-secondary">
                  Mon Espace
                </Link>
              </div>
            </div>
            <div className="hero-image-container">
              <img
                src={require("assets/img/ubci.jpg").default}
                alt="UBCI Banque"
                className="hero-image"
              />
              <div className="image-overlay"></div>
            </div>
          </div>
          <div className="background-shape shape1"></div>
          <div className="background-shape shape2"></div>
          <div className="background-shape shape3"></div>
        </section>

        {/* Reste du code inchangé... */}

      </div>

      {/* Feuille de style personnalisée */}
      <style jsx>{`
        /* Style général - Couleurs UBCI */
        /* Palette basée sur le logo UBCI:
           - Turquoise principal: #39BDC8
           - Vert foncé: #00514C
           - Turquoise clair: #7ED7DD
           - Blanc: #FFFFFF
        */
        
        .home-container {
          font-family: 'Poppins', sans-serif;
          color: #333;
          overflow-x: hidden;
        }

        /* Hero Section */
        .hero-section {
          position: relative;
          min-height: 100vh;
          padding: 4rem 0;
          overflow: hidden;
          background: linear-gradient(135deg, #f5f7fa 0%, #d9f2f4 100%);
        }

        .content-wrapper {
          max-width: 1200px;
          margin: 0 auto;
          padding: 0 2rem;
          display: flex;
          flex-wrap: wrap;
          align-items: center;
          justify-content: space-between;
        }

        .hero-content {
          width: 100%;
          max-width: 550px;
          margin-top: 4rem;
          z-index: 10;
        }

        .hero-title {
          font-size: 4rem;
          font-weight: 700;
          color: #00514C;
          line-height: 1.1;
          margin-bottom: 1.5rem;
        }

        .primary-text {
          color: #39BDC8;
        }

        .hero-description {
          font-size: 1.2rem;
          line-height: 1.6;
          color: #00514C;
          margin-bottom: 2.5rem;
        }

        .action-buttons {
          display: flex;
          gap: 1rem;
          flex-wrap: wrap;
        }

        .btn-primary {
          display: inline-block;
          padding: 1rem 2rem;
          background: linear-gradient(90deg, #39BDC8 0%, #00514C 100%);
          color: white;
          font-weight: 600;
          border-radius: 30px;
          text-decoration: none;
          box-shadow: 0 5px 15px rgba(57, 189, 200, 0.3);
          transition: all 0.3s ease;
        }

        .btn-primary:hover {
          transform: translateY(-3px);
          box-shadow: 0 8px 20px rgba(57, 189, 200, 0.4);
        }

        .btn-secondary {
          display: inline-block;
          padding: 1rem 2rem;
          background: #00514C;
          color: white;
          font-weight: 600;
          border-radius: 30px;
          text-decoration: none;
          box-shadow: 0 5px 15px rgba(0, 81, 76, 0.3);
          transition: all 0.3s ease;
        }

        .btn-secondary:hover {
          transform: translateY(-3px);
          box-shadow: 0 8px 20px rgba(0, 81, 76, 0.4);
        }

        .hero-image-container {
          position: relative;
          width: 100%;
          max-width: 550px;
          margin-top: 2rem;
          z-index: 5;
        }

        /* Style amélioré pour l'image */
        .hero-image {
          width: 100%;
          height: auto;
          border-radius: 12px;
          box-shadow: 0 15px 30px rgba(0, 81, 76, 0.15);
          transition: all 0.4s ease;
          border: 4px solid white;
        }

        .hero-image:hover {
          box-shadow: 0 20px 40px rgba(57, 189, 200, 0.25);
          transform: translateY(-8px);
        }

        .image-overlay {
          position: absolute;
          top: 0;
          left: 0;
          width: 100%;
          height: 100%;
          border-radius: 12px;
          background: linear-gradient(135deg, rgba(57, 189, 200, 0.2) 0%, rgba(0, 81, 76, 0.1) 100%);
          pointer-events: none;
        }

        .background-shape {
          position: absolute;
          border-radius: 50%;
          z-index: 1;
        }

        .shape1 {
          width: 300px;
          height: 300px;
          background: radial-gradient(circle, rgba(57, 189, 200, 0.1) 0%, rgba(57, 189, 200, 0.05) 70%, transparent 100%);
          left: -150px;
          top: 10%;
        }

        .shape2 {
          width: 400px;
          height: 400px;
          background: radial-gradient(circle, rgba(0, 81, 76, 0.08) 0%, rgba(0, 81, 76, 0.03) 70%, transparent 100%);
          right: -200px;
          top: 60%;
        }

        .shape3 {
          width: 200px;
          height: 200px;
          background: radial-gradient(circle, rgba(126, 215, 221, 0.1) 0%, rgba(126, 215, 221, 0.05) 70%, transparent 100%);
          left: 10%;
          bottom: 5%;
        }

        /* ... reste du CSS inchangé ... */

        /* Responsive Styles */
        @media (max-width: 768px) {
          .hero-content {
            max-width: 100%;
            margin-top: 2rem;
          }

          .hero-title {
            font-size: 3rem;
          }

          .hero-image-container {
            max-width: 100%;
            margin-top: 3rem;
          }
        }

        @media (max-width: 480px) {
          .hero-title {
            font-size: 2.5rem;
          }

          .action-buttons {
            flex-direction: column;
            width: 100%;
          }

          .btn-primary, .btn-secondary {
            width: 100%;
            text-align: center;
          }
        }
      `}</style>
    </>
  );
}
